import json

import pandas as pd
import datetime
import os
import time
from kiteconnect import KiteConnect
import numpy as np

class ohlc:
    def __init__(self):

        df_todays_companies = pd.read_csv('tradables.csv')
        dict_todays_companies = df_todays_companies.to_dict(orient='records')
        self.kite = KiteConnect(api_key = '7lwrah449p8wk3i0')
        self.kite.set_access_token(access_token='AjC6XDR94o7QLwgnh2Ga1Od4znNJOAQ4')
        list_ohlc=[]
        self.avg_sd_dict={}
        for company in dict_todays_companies:
            while True:
                try:
                    company_data = pd.DataFrame(
                        self.kite.historical_data(company['instrument_token'], from_date=(datetime.date.today() - pd.tseries.offsets.BDay(3)).date(),
                                             to_date=(datetime.date.today() - pd.tseries.offsets.BDay(1)).date(),
                                             interval='minute'))
                    company_data.drop('volume', axis=1)
                    company_data['symbol'] = company['symbol']
                    company_data['instrument_token'] = company['instrument_token']

                    company_data['sd_high'] = company_data['high'].rolling(10).std()
                    company_data['sd_low'] = company_data['low'].rolling(10).std()
                    company_data['sd'] = company_data[['sd_high', 'sd_low']].max(axis=1)
                    company_data['avg(sd)'] = company_data['sd'].mean()
                    company_data['date']=pd.to_datetime(company_data['date'].dt.strftime('%Y-%m-%d %H:%M:%S'))
                    company_data = company_data.set_index('date')
                    company_data = company_data.sort_index()
                    company_data = company_data.reset_index()
                    company_data=company_data[-30:]
                    list_ohlc.append(company_data)

                    self.avg_sd_dict[company['symbol']] = company_data['sd'].mean()
                except Exception as e:
                    print(e)
                    continue
                break
        self.ohlc_data=pd.concat(list_ohlc,axis=0)
        self.ohlc_data.info()
        self.ohlc_data['key']= self.ohlc_data['symbol']+':'+self.ohlc_data['date'].astype('int64').astype('str')
        print(self.ohlc_data)
        self.ohlc_data=self.ohlc_data.set_index(['symbol','date'])[['open','high','low','close','key']]
        redis_df=self.ohlc_data.reset_index().set_index('key')
        redis_df['date']=redis_df['date'].dt.strftime('%Y-%m-%d %H:%M:%S')
        redis_df['message'] = redis_df.apply(lambda x: x.to_json(), axis=1)
        redis_df.info()
        redis_dict = redis_df['message'].to_dict()
        print(redis_dict)


    def update(self,update_df):

        joined_df=pd.concat([self.ohlc_data,update_df],axis=1,join_axes=[update_df.index])
        joined_df['high']=np.where(joined_df['high'].isna(),joined_df['max'],joined_df[['max','high']].max(axis=1))
        joined_df['low'] = np.where(joined_df['low'].isna(), joined_df['min'], joined_df[['min', 'low']].min(axis=1))
        joined_df['open'] = np.where(joined_df['open'].isna(), joined_df['first'], joined_df['open'])
        joined_df['close']=joined_df['last']
        joined_df['key']=np.where(joined_df['key'].isna(),joined_df['new_key'],joined_df['key'])
        joined_df=joined_df[['open','high','low','close','key']]
        redis_df=joined_df.reset_index().set_index('key')

        redis_df['date'] = redis_df['date'].dt.strftime('%Y-%m-%d %H:%M:%S')

        redis_df['message']=redis_df.apply(lambda x:x.to_json(),axis=1)
        redis_df.info()
        redis_dict=redis_df['message'].to_dict()
        print(redis_dict)

        self.ohlc_data=joined_df.combine_first(self.ohlc_data)


